import React,{useEffect, useState} from "react";
import HeaderHome from "../Partials/HeaderHome";
import { BrowserRouter as Router, Routes, Route, Link } from "react-router-dom";

import './Cart.css'
function Cart(props){



const [values,setValues] = useState([]);

    useEffect(()=>{
      console.log(1)
        if(props.sess.user)
        {
          // console.log(props.sess.user)
        var data = {email:props.sess.user.email}
        // var body = {"email": props.sess.user.email}
      fetch('http://localhost:3001/cartData',{
        method: "POST",
        body: JSON.stringify(data),
        headers: {
          "Content-type": "application/json; charset=UTF-8",
        },
        credentials: "include",
      })
      .then(res => res.json())
      .then(
        (result) => {
          // console.log(result)
          // cartCount = result;
          setValues(result)
          
        }
      ) .catch((err) => {
        console.log(err);
      })}
      
      
    },[props])
    counting(values)
  


      function counting(arr)
{
  const count = {};

for (const element of arr) {
  if (count[element[0]]) {
    count[element[0]._id] += 1;
  } else {
    count[element[0]._id] = 1;
  }
  // console.log(arr)
}

console.log(count);
}
      // if(props.sess.isLoggedIn){
        
        if(props.sess.isLoggedIn == false)
        {
          window.location.href= '/login'
        }
        else
        // console.log(values[0]);
        return (
          <>
  
        <HeaderHome sess={props.sess} cartCount={props.cartCount} setCartCount={props.setCartCount}/>



<div className="cart transition is-open">
    {/* <Routes> */}
    <Link to="/" className="btn btn-update" id="update">Continue Shopping</Link>
    {/* </Routes> */}
    
    
    <div className="table">
      
      <div className="layout-inline row th">
        <div className="col col-pro">Product</div>
        <div className="col col-price align-center "> 
          Price
        </div>
        <div className="col col-qty align-center">QTY</div>
        <div className="col">VAT</div>
        <div className="col">Total</div>
      </div>
      
  {values.map((t,i)=>
  
      <div className="layout-inline row">
        
        <div className="col col-pro layout-inline">
          <img src="https://cdn.sweatband.com/mizuno_wave_inspire_14_ladies_running_shoes_aw18_mizuno_wave_inspire_14_ladies_running_shoes_aw18-_angled_2000x2000.jpg" alt="kitten" id="productImg" />
          <p>{t[0].name}</p>
        </div>
        
        <div className="col col-price col-numeric align-center ">
          <p>₹{t[0].price}</p>
        </div>

        <div className="col col-qty layout-inline">
          <a href="#" className="qty qty-minus">-</a>
            <input type="numeric" value="3" id="quantityVal" />
          <a href="#" className="qty qty-plus">+</a>
        </div>
        
        <div className="col col-vat col-numeric">
          <button>Delete</button>
        </div>
        <div className="col col-total col-numeric">               <p> {t[0].price * 3}</p>
        </div>
        
      </div>
    )}
      
     
  
       <div className="tf">
         <div className="row layout-inline">
           <div className="col">
             <p>VAT</p>
           </div>
           <div className="col"></div>
         </div>
         <div className="row layout-inline">
           <div className="col">
             <p>Shipping</p>
           </div>
           <div className="col"></div>
         </div>
          <div className="row layout-inline">
           <div className="col">
             <p>Total</p>
           </div>
           <div className="col"></div>
         </div>
       </div>         
  </div>
    
    <a href="#" className="btn btn-update" id="update">Update cart</a>
  
</div>
    </>
)
// }
// else{
// window.location.href('/login')
// }
}

export default Cart;
